import { TextField } from "@material-ui/core";
import React from "react";

const ShowInfo = (props) => {
  return (
    <div>
      <TextField value={props.userInfo.name}></TextField>
      <TextField value={props.userInfo.email}></TextField>
      <TextField value={props.userInfo.rating}></TextField>
      <TextField value={props.userInfo.resumePath}></TextField>
      <TextField value={props.userInfo.imagePath}></TextField>
    </div>
  );
};

export default ShowInfo;
